import React, { Component } from 'react';



class Secondblog extends Component {
  render() {
    return (

      <div>
      <h1>
      As you know this is gonna be the 2nd blog page. what up yo.
      </h1>

      <img src="https://leger2.imgix.net/Includes/images/overview/italy/rome.jpg?auto=compress,enhance,format&q=30" alt="Italy">
      </img>

      <p>
      YOYOYOYOY
      </p>
      </div>

    );
  }
}

export default Secondblog;
